			// cor da ferramenta brush
			var color = "#81E006";
			var colorName = "green";
			// identifica se a ferramenta pode ou não seguir o mouse
			var canFollow = false;
			
			// identifica se precisa carregar algum carro
			var dragging = false;
			// carros no processo de troca
			var tookenCars = [];
			// carro sendo carregado
			var carGrabbed;
			// spot do carro que está sendo carregado
			var originalSpot;
			// quantidade de exercícios
			var ecount = 0;
			// quantas respostas foram corretas
			var accuracy = 0;
			
			game.hasModal = true;
			
			// construtores dos carros
			var constructors = [lib.Car00, lib.Car01, lib.Car02, lib.Car03, lib.Car04, lib.Car05, lib.Car06, lib.Car07, lib.Car08, lib.Car09, lib.Car10, lib.Car11];
			// Método inicial do jogo
			this.inicializa = function()
			{
				random(exercises);
				setTimeout(newExercise, 25);
				placeCars();
				createjs.Ticker.on("tick", update);
			}
			// Método responsável por criar novo exercício
			function newExercise()
			{
				if (ecount < 5)
				{
					var ex = new lib.Exercises();
					// posiciona o exercício no meio da tela
					ex.set( { x : -stage.canvas.width * 0.5 / stage.scaleX, y : -stage.canvas.height * 0.5  / stage.scaleY } );
					// adiciona ao game
					e.addChild(ex);
					//
					ex.gotoAndPlay(1);
					// seta o conteúdo da mensagem
					ex.campo.text.text = exercises[ecount].msg;
					// troca o texto das instruções 
					instruction.text = exercises[ecount].msg;
					
					ecount++;
					//step.text = ecount + "/5";
					game.hasModal = true;
				}
				else
				{
					var ending = new lib.Ending();
					// posiciona o exercício no meio da tela
					ending.set( { x : -stage.canvas.width * 0.5 / stage.scaleX, y : -stage.canvas.height * 0.5 / stage.scaleY} );
					// adiciona ao game
					e.addChild(ending);
					// 
					ending.gotoAndPlay(1);
					// texto que vai no painel de resultado
					ending.campo.text.text = "Você acertou " + accuracy + " de 5 exercícios.";
					
					game.hasModal = true;
				}
			}
			// Cria e posiciona os carros aleatoriamente
			function placeCars()
			{
				constructors = constructors.concat(constructors.slice(0, 8));
				random(constructors);
				
				var count = 0;
				var car;
				for (var i = 0; i < constructors.length; i++)
				{
					count = count >= 10 ? 1 : count + 1;
					
					car = new constructors[i]();
					var str = i < 10 ? "car0" : "car";
					car.name = str + i;
					car.on("mousedown", carHandler);
					car.rotation = count <= 5 ? 0 : 180;
					
					str = i < 10 ? "spot_0" : "spot_";
					e[str + i].name = str + i;
					e[str + i].addChild(car);
				}
			}
			// Método responsável por posicionar um carro de acordo com o spot e a rotação
			function posicioneDraggedCar(car, spot)
			{
				// array com os números dos spots que representam a fileira superior de cada conjunto
				var upSpots = [0, 1, 2, 3, 4, 10, 11, 12, 13, 14];
				// número de fato
				var n = parseInt(spot.name.substr(-2));
				var rotation = 0;
				var yPos = 0;
				
				// se o indice estiver no array da fileira de cima mantém a rotação 0, senão atrubui a rotação 180
				if (upSpots.indexOf(n) == -1)
					rotation = 180;
				
				car.rotation = rotation;
				car.set( { x:0, y:yPos } );
			}
			// Evento disparado quando um carro é pressionado
			function carHandler(event)
			{
				if (game.hasModal) return;
				
				var car = event.currentTarget;
				var spot = car.parent;
				
				if (tool)
				{
					if (tool.name == "hand")
					{
						if (tookenCars.length > 0)
						{
							// posicionando o carro arrastado
							posicioneDraggedCar(carGrabbed, spot);
							// posicionando o carro recém clicado
							posicioneDraggedCar(car, originalSpot);
							// adiciona o carro arrastado ao novo spot
							spot.addChild(carGrabbed);
							// adiciona o carro atual ao spot antigo 
							originalSpot.addChild(car);
							// evento click
							carGrabbed.on("click", carHandler);
							// espera meio segundo e então remove o pincel
							setTimeout(removeBrush, 500);
							// corrige resposta
							setTimeout(checkChange, 1000, {car : carGrabbed.name, change : car.name});
							
							// reset
							tookenCars = [];
							originalSpot = null;
							carGrabbed = null;
							dragging = false;
						}
						else
						{
							// instancia novo carro
							carGrabbed = new car.constructor();
							// habilita arrastar
							dragging = true;
							
							carGrabbed.alpha = 0;
							carGrabbed.name = car.name;
							// atribui a mesma rotação do original
							carGrabbed.rotation = car.rotation;
							// marca o spot original
							originalSpot = spot;
							// posiciona no espaço
							carGrabbed.set({x:1500, y:-500});	
							// adiciona ao array
							tookenCars.push(carGrabbed);
							// remove o carro original
							spot.removeChild(car);
							// remove a ferramenta
							e.removeChild(tool);
							e.addChild(carGrabbed);
							carGrabbed.alpha = 1;
						}
					}
					else if (tool.name == "brush")
					{
						if (color)
						{
							var shape = car.color.getChildAt(0);
							changeShapeColor(shape, color);
							// espera meio segundo e então remove o pincel
							setTimeout(removeBrush, 500);
							
							// corrige resposta
							setTimeout(checkPaint, 1000, {car : car.name, color: color});
						}
						else
						{
							wrongStep("Você precisa escolher uma cor antes de tentar pintar o carro.");
						}
					}
					else if (tool.name == "x")
					{
						canFollow = false;
						
						if (spot.numChildren > 2)
						{
							// remove ferramenta e avisa que já tem uma marcação no carro
							e.removeChild(tool);
							wrongStep("Este carro já foi marcado."); 
							
							// corrige resposta
							setTimeout(checkMark, 1000, {car : "", color: ""});
						}
						else
						{
							// adiciona o x ao spot
							spot.addChild(tool);
							// posiciona o x no spot
							var yPos = car.rotation == 0 ? -25 : 25;
							tool.set({x:0, y:yPos});
							tool.name = "";
							tool = null;
							
							// corrige resposta
							setTimeout(checkMark, 1000, { car : car.name });
						}
					}
				}
				else
				{
					wrongStep("Você precisa escolher uma ferramenta antes.");
				}
			}
			// Altera a cor do carro
			function changeShapeColor(shape, color)
			{
				shape.graphics.clear();
				shape.graphics.beginFill(color).drawRect(-50*0.5, -90*0.5, 50, 90);
			}
			// Método responsável por remover o pincel 
			function removeBrush()
			{
				if (tool)
				{
					canFollow = false;
					e.removeChild(tool);
				}
			}
			// Evento disparado quando uma das ferramentas é selecionada
			function toolHandler(event)
			{
				if (game.hasModal) return;
				
				var nome = event.target.name;
				
				if (tool)
					e.removeChild(tool);
				
				if (nome != exercises[ecount - 1].tool)
				{
					if (tool)
						e.removeChild(tool);
					wrongStep("Você escolheu a ferramenta errada.");
				}
				else
				{
					if (nome == "hand")
						tool = new lib.Hand();
					else if (nome == "brush")
					{
						tool = new lib.Brush();
						tool.gotoAndStop();
					}
					else
						tool = new lib.X();
					
					tool.name = nome;
					
					canFollow = true;
					// calcula a posição do mouse de acordo com o escopo atual
					var point = e.globalToLocal(stage.mouseX, stage.mouseY);
					tool.set({x:point.x, y:point.y});
					// adiciona a ferramente à instancia do estacionamento
					e.addChild(tool);
				}		
			}
			// Disparado quando uma das cores é clicada
			function colorHandler(event)
			{
				if (game.hasModal) return;
				
				if (!tool || tool.name != "brush")
					return;
				color = event.currentTarget.color;
				// nome do balde
				var n = event.currentTarget.name;
				colorName = n;
				// frame para o qual o pincel precisa ir
				var frame = n == "green" ? 0 : n == "black" ? 1 : n == "red" ? 2 : n == "white" ? 3 : n == "blue" ? 4 : 5;
				tool.gotoAndStop(frame);
				brushtool.gotoAndStop(frame);
			}
