			function checkChange (args)
			{
				//console.log("Change", args.car, exercises[ecount-1].car, " |||| ", args.change, exercises[ecount-1].change);
				// instancia o objeto Result
				var result = instantiateModal(lib.Result);
				// verifica se as respostas estão corretas
				var comparisons = args.car == exercises[ecount-1].car && args.change == exercises[ecount-1].change;
				// invoca o método que apresenta o feedback
				setFeedback(result, comparisons);
			}
			// Método responsável por fazer a correção da marcação de veículo
